css:
@-moz-document domain(flacmusicfinder.com){
h1,h2,h3,h4,h5,h6,.h1,.h2,.h3,.h4,.h5,.h6{color:#aaa!important;}
a,.a,div,.div{color:#c6d0d78a!important;}
.breadcrumb,.page-container .page-content,.footerendp{background:#2a2d34!important;}
.btn-default{border-color:#2a2d34!important;}
.list-tags li a,.list-tags li a:hover{background:#22242a!important;border-color:#2a2d34!important;}
.pagination > li > a,.pagination > li > span{background:#2a2d34!important;border-color:#22242a!important;}
.panel,.panel .panel-heading,.panel .panel-footer,.panel .panel-body{border-top-color:#2f323a!important;border-right-color: #2f323a!important;background:#2f323a!important;}
.m-yt-search-title{background:#2f323a!important;}
.panel-default .panel-heading,.panel-primary .panel-heading,.panel-success .panel-heading,.panel-info .panel-heading,.panel-warning .panel-heading,.panel-danger .panel-heading{background:#2f323a!important;border-color:#22242a!important;}
.m-yt-search,.form-control{background:#2a2d34!important;border-color:#22242a!important;}
.img-text{border:3px solid#2f323a!important;}
}
